$(document).ready(function () {
    $.ajax({
        url: "menuadmin.html",
        context: document.body
    }).done(function (data) {
        if($("#sidebar").length == 0){
            $("#topo").prepend(data);
            $(".page-loader__spin").removeClass()
            $(".page-loader").removeClass()
        }
    });

    imagensPadrao();

    var elementos = $("[name*='vl_']")
    for (let index = 0; index < elementos.length; index++) {
        const element = elementos[index];
        $(element).mask("#.##0,00", { reverse: true })
        $(element).attr("style", "text-align:right")
    }

    
    getuser();

    $(".page-loader__spin").removeClass()
    $(".page-loader").removeClass()
});


function imagensPadrao() {

    $(".image-product img").attr('src', 'data:image/jpeg;base64,');

}

$(".image-product img").click(function () {
    $(".image-product input[type='file']").click();
})

$(".image-product input[type='file']").change(function () {
    console.log($(this).val());
    var file = document.querySelector('input[type="file"]').files[0];
    getBase64(file).then(
        data => $(".image-product img").attr("src", data)
    );
    getBase64(file).then(
        data => $(".image-product input[type='hidden']").val(data)
    );


});

function getBase64(file) {
    return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onload = () => resolve(reader.result);
        reader.onerror = error => reject(error);
    });
}



function getuser(){
    if(!localStorage.getItem("username")){
        window.location.href = "http://" + window.location.host + "/pages/login.html";
        return;
    }

    $("#nomeusuarioativo1").html(localStorage.getItem("username"));
    $("#nomeusuarioativo2").html(localStorage.getItem("username"));
    $("#rotulobemvindo").html(localStorage.getItem("username"));

    var tipo = localStorage.getItem("tipo");

    $("#tipousuarioativo").html(tipo);

    var cnpj = localStorage.getItem("cnpj")
    var id = localStorage.getItem("userid")
    var url = "http://" + window.location.hostname + ":3000/api/administrador/imgsistema/" + id;
                 
    $.ajax({        
        type: "GET",
        url: url,  
        headers: {
            "cnpj": cnpj 
          },
        success: function(data){
            if(data){
                if(data.length > 0){
                    if(data[0]){
                        $("#foto1").attr("src", data[0].img_foto);
                        $("#foto2").attr("src", data[0].img_foto);
                    }
                }
            }
        }
    })
    


}